import styled from "styled-components";
import AuthLayout from "../auth/AuthLayout";
import PageTitle from "../shared/PageTitle";

function Login() {
  return (
    <AuthLayout>
      <PageTitle title="Login" />
      <HeaderContainer></HeaderContainer>
      <form>
        <input></input>
        <input></input>
        <button />
      </form>
      <seperator />
    </AuthLayout>
  );
}
export default Login;
